import styled from "styled-components";

const StyledRoom = styled.div`
  display: flex;
  flex-direction: column;
  max-width: 200px;
  border-style: solid;
  border-color: #bfbfbf;
  border-radius: 5px;
  margin-bottom: 10px;
  margin-right: 5px;
`;

export default StyledRoom;
